<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Dashboard</title>
    <link rel="stylesheet" href="../../../style/css/admin-css/Dashboad.css">
</head>
<body >

<div class="container row">

    <div class="side_bar mid_align">
        <iframe id="frame_side_bar" src="../../../components/reuse/AdminSidebar.html" frameborder="0"></iframe>
    </div>







    <div class="main">
        <div id="header" class="">
            <iframe id="frame_header" src="../../../components/reuse/AdminHeader.html" frameborder="0"></iframe>
        </div>


        <div id="body">


            <div class="card_list row mid_align">
                <div class="card ">
                    <iframe id="frame_viewport" src="../../../components/chart/Viewport.html" frameborder="0"></iframe>

                </div>



                <div class="card">
                    <iframe id="frame_pie" src="../../../components/chart/PieChart.html" frameborder="0"></iframe>
                </div>

                <div class="card">
                    <iframe id="frame_total_user" src="../../../components/chart/TotalUser.html" frameborder="0"></iframe>
                </div>


                <div class="card">
                    <iframe id="frame_new_user" src="../../../components/chart/NewUser.html" frameborder="0"></iframe>

                </div>
            </div>


            <div class="over_view mid_align">
                <iframe id="frame_over_view" src="../../../components/chart/ChartComponent.html" frameborder="0"></iframe>

            </div>


        </div>






    </div>

</div>
